class Solution:
    def countCompleteSubstrings(self, word: str, k: int) -> int:
        def getNumber(word,k):
            #print(len(word))
            if len(word) < k:
                return 0
            n = len(word)
            acc = 0
            for i in range(1,27):
                ln = i*k
                c = Counter(word[:ln])
                if len(c.keys()) == i and n >=ln and set(c.values()) ==set([k]):
                    acc +=1
                for j,a in enumerate(word[ln:]):
                    c[a] +=1
                    b = word[j]
                    c[b] -=1
                    if c[b] ==0:
                        del c[b]
                    if len(c) ==i and set(c.values()) ==set([k]):
                        #print(i,j)
                        acc +=1
                #print(i,acc)
            return acc
        sm = 0
        l = 0
        #print(len(word))
        for i,a in enumerate(word[1:],1):
            if abs(ord(word[i]) -ord(word[i-1])) >2:
                sm += getNumber(word[l:i],k)
                l = i
        sm += getNumber(word[l:],k)
        return sm
        
            
        


